import Menu from "./components/menus/menus";
import Home from "./components/home/Home";
import { Route, Routes } from 'react-router-dom'

function App() {
  return (
  <div>
    <Routes>
      <Route path="/" element={<Home/>}/>
      <Route path="/menu" element={<Menu/>}/>
    </Routes>

  </div>
  );
}

export default App;
